import{_ as e}from"./plugin-vue_export-helper-c27b6911.js";import{o,c as t,f as l}from"./app-f8e4fa2d.js";const c="/WynncraftCNguide/assets/img/lvl85-1.jpg",i={},p=l('<h1 id="the-lost-level-85" tabindex="-1"><a class="header-anchor" href="#the-lost-level-85" aria-hidden="true">#</a> The Lost (level 85)</h1><p><strong>失联</strong></p><p>1.跟<em>Dejol</em>说话<code>[452 28 -4456]</code></p><blockquote><p>你可以找一下巨大的蓝色旗帜</p></blockquote><p>2.在附近通过红色旗帜找到<em>Dejol</em>的队友</p><div class="hint-container tip"><p class="hint-container-title">提示</p><p><img src="'+c+'" alt="" loading="lazy"><br> 其实可以沿着山路一直走上去，就可以依次找到三个队友了</p><p>下面的攻略也会按照这个顺序编写</p></div><p>3.在<code>[447 59 -4507]</code>找到<em>Fetu</em>，他被巨鸟抓走了，想办法救他下来</p><div class="hint-container tip"><p class="hint-container-title">提示</p><p>为了救出<em>Fetu</em>，你需要在附近找到四个鸟蛋</p><p>如果你没有触发剧情，可以走远点再次来到坐标处触发！</p><p>鸟蛋分别位于：</p><ul><li><code>[451 54 -4492]</code>(鸟巢下面的石头)</li><li><code>[457 58 -4513]</code>(树叶下面)</li><li><code>[445 59 -4515]</code>(桥旁边)</li><li><code>[440 61 -4502]</code>(该坐标为跑酷起点，通过跑酷即可看到第四个鸟蛋)</li></ul><p>完成后，对着投掷鸟蛋的触发点右键即可完成任务</p></div><p>4.继续前进，来到第二座红色旗帜下<code>[338 104 -4463]</code>，通过一段山路跑酷，注意绿色平台会触发地震，别给整下去了</p><p>一路跟着棕色地毯走就行，然后和<em>Yuge</em><code>[347 147 -4482]</code>对话，左键推他下去</p><div class="hint-container tip"><p class="hint-container-title">提示</p><p>如果你跟下来后没在水池边上看到Yuge，建议回到<code>[347 147 -4482]</code>后/class</p></div><p>5.继续沿着山路走，来到第三座红色旗帜附近<code>[328 123 -4352]</code>，在屋子内找到<em>Gordon</em>，触发地震剧情</p><p>6.收集绳索、木头、石头后做一个...投石机？然后和<em>Gordon</em>对话，选项任意，之后坐上去就行了</p><p>7.回去<em>Dejol</em>那里</p><p>奖励</p><ul><li>1575000 经验</li><li>2048 绿宝石</li><li>Canyon Chart(地图)</li></ul>',16),n=[p];function s(d,a){return o(),t("div",null,n)}const h=e(i,[["render",s],["__file","level 85 - The Lost.html.vue"]]);export{h as default};
